// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './style.css';

import Home from './components/Home';  // Assuming you have a Home component for login/signup
import Library from './components/Library';  // Assuming you have a Library component for the user dashboard
import AdminDashboard from './components/AdminDashboard';  // Assuming you have an AdminDashboard component
import Logout from './components/Logout';  // Assuming you have a Logout component

const App = () => {
  return (
    <Router>
      <div className="app-container">
        <Routes>
          {/* Route for Login/Signup */}
          <Route path="/" element={<Home />} />

          {/* Route for User Dashboard or Library */}
          <Route path="/library" element={<Library />} />

          {/* Route for Admin Dashboard */}
          <Route path="/admin" element={<AdminDashboard />} />

          {/* Route for Logout */}
          <Route path="/logout" element={<Logout />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
